import games from './info';

function searchById(id) {
  // for (let i = 0; i < games.length; i++) {
  //   if (games[i].id == id) {
  //     return games[i];
  //   }
  // }
  for (let game of games) {
    if (game.id === id) return game;
  }
}

export default searchById;
